import axios from 'axios';
import React, {useState} from 'react'
import { Link } from 'react-router-dom'

function Contact() {
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [message, setMessage] = useState('');

    const onSubmit = () => {
        axios.post('localhost:8000', name, email, message)
        // https://sheet.best/api/sheets/6490fc47-a3db-4cc7-8508-16c178b0b032
    }
  return (
    <div className='about-section' id="contact">
        <h1>Interested? Contact us!</h1>
        <p>Fill out this form to let us know how we can help you. All information provided is 100% free. Always. We donâ€™t spam. Ever.</p>
        <div className='row'>
            <div className='box' id='box1'>
                <h2>Schedule a meeting with us:</h2>
                <a href='https://go.oncehub.com/TalkToSethHenry' target={'a_blank'}><button type="button" id="submit-button">Schedule a Meeting on OnceHub</button></a>
            </div>
            <div className='box' id='box2'>
                <h2>Send us your questions and messages:</h2>
                <form>
                    <input type="text" id="name" placeholder='Your full name...' class="input-field" onChange = {(e) => setName(e.target.value)}/><br></br>
                    <input type="email" id="email" placeholder='Your email address...' class="input-field" onChange = {(e) => setEmail(e.target.value)}/><br></br>
                    <input type="message" id="message" placeholder='Your message...' class="input-field" onChange = {(e) => setMessage(e.target.value)}/><br></br>
                    <button type='submit' id="submit-button" onClick={onSubmit}>Send Message</button>
                </form>
            </div>
        </div>
    </div>
  )
}

export default Contact
